sys_variable_value.value:
(function execute(inputs, outputs) {

    // If the ordinal number of pages to get (inputs.first_glacier) value is zero or less than zero, or if the ordinal 
    // number is greater than the number of glacier records in the database, set outputs.first_glacer_to_get to the 
    // string value 1.  If not, set the value of first_glacer_to_get to inputs.first_glacier.

    if (parseInt(inputs.first_glacier) <= 0 || parseInt(inputs.first_glacier) > 132890) {
        outputs.first_glacier_to_get = "1";
    } else {
        outputs.first_glacier_to_get = inputs.first_glacier;
    }

    // The World Glaciers web service returns a 442 error if the page size is not between 1 and 10 inclusive. To avoid 
    // receiving an error, check the value of the page size (inputs.glaciers_per_page).  If the value is outside of the 
    // allowed range, set outputs.glaciers_per_page to the string value 1.  Otherwise, set outputs.glaciers_per_page to 
    // inputs.glaciers_per_page.

    if (parseInt(inputs.glaciers_per_page) <= 0 || parseInt(inputs.glaciers_per_page) > 10) {
        outputs.glaciers_per_page = "1";
    } else {
        outputs.glaciers_per_page = inputs.glaciers_per_page;
    }

    // If the number of pages to get (inputs.pages_to_get) value is zero or less than zero, set outputs.number_of_pages 
    // to the string value 1. If not, set the value of outputs.number_of_pages to inputs.pages_to_get.

    if (parseInt(inputs.pages_to_get) <= 0) {
        outputs.number_of_pages = "1";
    } else {
        outputs.number_of_pages = inputs.pages_to_get;
    }
})(inputs, outputs);

