sys_variable_value.value:
(function paginate(variables, pageResponse) {
    // The script determines whether to retrieve another page of glacier records from the web service.
    // Calculate how many records to retrieve then determine the ordinal number of the last glacier to get

    var totalRecs = parseInt(variables.glaciers_per_page) * parseInt(variables.num_pages);
    var lastRec = parseInt(variables.start_with) + totalRecs;

    // If the value of variables.glacier_number is less than the ordinal of the last record to get, get another page.   
    // If not, set variables.getNextPage to false.

    if (parseInt(variables.glacier_number) < lastRec) {
        variables.getNextPage = true;
    } else {
        variables.getNextPage = false;
    }
})(variables, pageResponse);

